"use strict"
var _=require("lodash")
$(function(){var a=$("[data-example]")
a.each(function(a,e){var r=$(e).data("example"),t=$(r).html()
t=t.replace(/\s*$/,"")
var n=t.split("\n")
n=_.without(n,"")
for(var i=!0;i;){for(var l=new Array(n.length),o=0;o<n.length;o++){if(0!==n[o].indexOf("\t")){i=!1,l=n
break}l[o]=n[o].substr(1)}n=l}$(e).text(_.join(n,"\n"))})})
